package com.xzx.xzxms.vm;public class ProIsFinallyVM {    private long dateTime;    private String proName;    private long proId;    private int finallyStatus;    public long getDateTime() {        return dateTime;    }    public void setDateTime(long dateTime) {        this.dateTime = dateTime;    }    public String getProName() {        return proName;    }    public void setProName(String proName) {        this.proName = proName;    }    public long getProId() {        return proId;    }    public void setProId(long proId) {        this.proId = proId;    }    public int getFinallyStatus() {        return finallyStatus;    }    public void setFinallyStatus(int finallyStatus) {        this.finallyStatus = finallyStatus;    }}